import React from "react";

let Plus = () => {
  return(
    <>
      <div className = "container">
      <form>

        <h1>Hello </h1>
          <input type = "text" placeholder = "Enter Your firstName"/><br/><br/>
          <input type = "text" placeholder = "Enter Your lastName"/><br/><br/>
        <button>Click Me</button>

      </form>
      </div>
    </>
  );
}

export default Plus;
